var content_f34_30_35299=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F81055&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F81055&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 608px\">",
"   <div class=\"ttl\">",
"    Brain MRI of a 16 year old girl with vanishing white matter disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 588px; height: 187px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    MR images of Patient 3. Shown are the transverse T2-weighted (A, B), proton density (C), and coronal fluid-attenuated inversion recovery (FLAIR) (D) images. The abnormal cerebral hemispheric white matter has a homogeneously high signal on T2-weighted images, but partly high and partly low signals on proton density and FLAIR images. The signal intensity is lowest in the white matter closest to the lateral ventricles (C, D). Note the radiating stripelike pattern in the low-signal intensity areas (C, D). Within the posterior limb of the internal capsule, a double line of signal abnormality is seen (B; arrows). Within the brainstem, the central tegmental tracts (A; small arrows) and transverse pontine fibers (A; large arrows) are involved.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Van der Knaap MS, Kamphorst W, Barth PG. Phenotypic variation in leukoencephalopathy with vanishing white matter. Neurology 1998; 51:540. Copyright &copy; 1998 Lippincott Williams &amp; Wilkins.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
